import './App.css';
import React, { useState } from "react";
import { Grid, Button, Drawer, List, ListItem, Typography } from "@material-ui/core";
import { MenuIcon } from "@material-ui/icons/menu";
import '@fontsource/roboto';
import lybLogo from "./lybLogo2.png";


function App() {

  const [openNav, setOpenNav] = useState(false);
  const [pageSelect, setPageSelect] = useState("home")

  const openDrawer = (e) => {
    e.preventDefault();
    setOpenNav(!openNav);
    console.log(openNav);
  }

  const openPage = (e, page) => {
    e.preventDefault();
    setPageSelect(page);
    setOpenNav(false)
    console.log(page);
  }

  const page = ["Contact", "About", "Prenatal", "Labor and Birth", "Newborn"]

  return (
    <div className="App">
      <Grid container>
        <Grid md="1" xs="1">

        </Grid>

        <Grid md="10" xs="10">
          <img src={lybLogo} style={{ width: "60%", height: "auto", paddingTop: "8%", paddingLeft: "8%", paddingRight: "8%" }}/>
        </Grid>

        <Grid md="1" xs="1">
          <Button onClick={openDrawer}>Menu</Button>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="end">
              <MenuIcon />
            </IconButton>
        </Grid>
      </Grid>


      <Drawer anchor="left" open={openNav}>
        <List>
          {page.map((item) => (
            <ListItem> 
              <Button onClick={e => openPage(e, item)}>{item}</Button>
            </ListItem>
          ))}
          <Button onClick={openDrawer}>Exit</Button>
        </List>
      </Drawer>
    </div>
  );
}

export default App;
